ednesday,  Thursday,  Friday<br/><b>Frequency: <\/b>Weekly<br/><b>Season: <\/b>4/7/2025 - 12/9/2025<br/><br/> <b><a href='http://www.urbangrowerscollective.org/' target='_blank'>Website<\/a><\/b>    |    <b><a href='http://www.instagram.com/urbangrowerscollective/' target='_blank'>Instagram<\/a><\/b>    |    <b><a href='http://www.facebook.com/urbangrowerscollective/' target='_blank'>Facebook<\/a><\/b><br/><br/>Mobile Farmers Market is stocked with UGC farm produce, partners’ produce and value added goods, and supplemented with wholesale produce. FMMM stops at partner site locations throughout the week and for community health interventions to improve overall community health through food access, recipes and nutrition, and awareness of food systems\n\nFor more information about where the market will be, see our schedule at \n\nhttps://www.urbangrowerscollective.org/fresh-moves-mobile-market#schedule","<b>Growing Home, Inc. Pop Up<\/b><br/><br/>Type: Mobile Market<br/><br/><b>Days: <\/b>Friday<br/><b>Frequency: <\/b>Weekly<br/><b>Season: <\/b>5/12/2025 - 10/31/2025<br/><br/> <b><a href='http://www.growinghomeinc.org/' target='_blank'>Website<\/a><\/b>    |    <b><a href='http://www.instagram.com/growinghome/' target='_blank'>Instagram<\/a><\/b>    |    <b><a href='http://www.facebook.com/growinghomeinc' target='_blank'>Facebook<\/a><\/b><br/><br/>We will begin operating a mobile market trailer to service areas which do not have nearby access to fresh produce. At this time we are still determining an exact schedule and locations for this mobile market, however, we primarily plan to serve Englewood in locations that grocery stores have closed and/or senior centers.","<b>Jo Daviess Local Foods<\/b><br/><br/>Type: Mobile Market<br/><br/><b>Days: <\/b>Tuesday<br/><b>Frequency: <\/b>Weekly<br/><b>Season: <\/b>1/7/2025 - 12/23/2025<br/><br/> <b><a href='http://www.jdlf.org' target='_blank'>Website<\/a><\/b>    |    <b><a href='http://www.instagram.com/jdlocalfoods' target='_blank'>Instagram<\/a><\/b>    |    <b><a href='http://www.facebook.com/groups/jdlfmarket/' target='_blank'>Facebook<\/a><\/b><br/><br/>Customers order online, and then we deliver orders every Tuesday, year-round.","<b>LEAF Food Hub<\/b><br/><br/>Type: Mobile Market<br/><br/><b>Days: <\/b>Friday-Tuesday<br/><b>Frequency: <\/b>Weekly<br/><b>Season: <\/b>1/9/2025 - 12/18/2025<br/><br/> <b><a href='http://www.leaffoodhub.com/' target='_blank'>Website<\/a><\/b>    |    <b><a href='http://www.instagram.com/leaffoodhub/' target='_blank'>Instagram<\/a><\/b>    |    <b><a href='http://www.facebook.com/LEAFFoodHub' target='_blank'>Facebook<\/a><\/b><br/><br/>Open year round - check website for details\n\nOn-line ordering: Fridays 12pm - Tuesdays 8pm\n\nPick-up/delivery: Thursday afternoons","<b>LUCSA<\/b><br/><br/>Type: CSA<br/><br/><b>Days: <\/b>Wednesday,  Thursday,  Friday<br/><b>Frequency: <\/b>Weekly<br/><b>Season: <\/b>1/1/2025 - 12/31/2025<br/><br/> <b><a href='http://www.theurbancanopy.org/' target='_blank'>Website<\/a><\/b>    |    <b><a href='http://www.instagram.com/theurbancanopy/' target='_blank'>Instagram<\/a><\/b>    |    <b><a href='http://www.facebook.com/people/The-Urban-Canopy/61557158537143/#' target='_blank'>Facebook<\/a><\/b><br/><br/>LUCSA stands for Local Unified Community Supported Agriculture. We deliver a box of locally-sourced produce weekly throughout the year in the greater Chicagoland area.\nLUCSA signup language: Sign-ups are now open year round! To sign up go to our website: theurbancanopy.org/csa Questions can be emailed to LUCSA@theurbancanopy.org","<b>Market 309 - Trewyn Park<\/b><br/>2219 S Idaho St<br/>Peoria, IL  61605<br/><b><a href='https://www.google.com/maps/dir/?api=1&destination=2219+S+Idaho+St+Peoria+IL' target='_blank'>Get Directions<\/a><\/b><br/><br/>Type: Pop-up Market<br/><br/><b>Days: <\/b>Sunday<br/><b>Hours: <\/b>11:30 AM - 01:00 PM<br/><b>Frequency: <\/b>Weekly<br/><b>Season: <\/b>1/1/2025 - 12/31/2025<br/><br/> <b><a href='http://www.peoriagrown.com/' target='_blank'>Website<\/a><\/b>    |    <b><a href='http://www.instagram.com/peoriagrown/' target='_blank'>Instagram<\/a><\/b>    |    <b><a href='http://www.facebook.com/peoriagrown' target='_blank'>Facebook<\/a><\/b><br/>","<b>Muzz Mobile<\/b><br/><br/>Type: Mobile Market<br/><br/><b>Days: <\/b>Monday,  Tuesday,  Wednesday,  Thursday,  Friday,  Saturday,  Sunday<br/><b>Frequency: <\/b>Other<br/><b>Season: <\/b>3/1/2025 - 11/15/2025<br/><br/> <b><a href='http://www.gpcommunitycouncil.org/events' target='_blank'>Website<\/a><\/b>    |    <b><a href='http://www.instagram.com/gpccouncil' target='_blank'>Instagram<\/a><\/b>    |    <b><a href='http://www.facebook.com/gpccouncil/' target='_blank'>Facebook<\/a><\/b><br/><br/>Our mobile farmers market (i.e. 'Muzz Moblie') is used whenever we have excess produce from our 'Garfield Park Neighborhood Market'. It is usually ran on the Sunday, Monday, or Tuesday after the market.","<b>Plant Chicago Indoor Firehouse Market<\/b><br/>4459 S Marshfield Ave<br/>Chicago, IL  60609<br/><b><a href='https://www.google.com/maps/dir/?api=1&destination=4459+S+Marshfield+Ave+Chicago+IL' target='_blank'>Get Directions<\/a><\/b><br/><br/>Type: Retail Space<br/><br/><b>Days: <\/b>Friday,  Saturday<br/><b>Hours: <\/b>11:00 AM - 05:00 PM <br/><b>Frequency: <\/b>Weekly<br/><b>Season: <\/b>1/3/2025 - 12/20/2025<br/><br/> <b><a href='http://www.plantchicago.org' target='_blank'>Website<\/a><\/b>    |    <b><a href='http://www.instagram.com/plantchicagonfp' target='_blank'>Instagram<\/a><\/b>    |    <b><a href='http://www.facebook.com/plantchicagonotforprofit' target='_blank'>Facebook<\/a><\/b><br/>","<b>Top Box Foods<\/b><br/><br/>Type: Grocery Delivery Service<br/><br/><b>Days: <\/b>Monday,  Tuesday,  Wednesday,  Thursday,  Friday<br/><b>Frequency: <\/b>Weekly<br/><b>Season: <\/b>1/1/2025 - 12/31/2025<br/><br/> <b><a href='http://www.topboxfoods.com' target='_blank'>Website<\/a><\/b>    |    <b><a href='http://www.instagram.com/topboxfoods' target='_blank'>Instagram<\/a><\/b>    |    <b><a href='http://www.facebook.com/TopBoxFoods/' target='_blank'>Facebook<\/a><\/b><br/><br/>Overview:\nTop Box Market is an online grocery market that creates access to healthy, affordable food. We offer fresh fruits and vegetables, meats, seafood, and poultry, dairy, grains, meal kits, and more. To make grocery shopping easier for our community, we deliver for no added fee across Cook County every week. SNAP Shoppers double their dollar with the Link Match program, available in partnership with Experimental Station at Top Box Market. \n\nHow It Works for Customers: Link Match at Top Box Market\n-First, purchase any Top Box Market products with a Link Card. Shop online at topboxfoods.com or with support from our Customer Service team at 312-527-7890. When you place your first order, you’ll create an account on our website where you can view your Link Match and order history. \n-EBT/SNAP spending is matched dollar-for-dollar every order, earning you Link Match dollars to save money on your next Top Box Market order. Log into your Top Box Market account on our website and click the Link Match button in the corner to view your available Link Match dollars.\n-Link Match dollars can be redeemed for products with fresh fruits and vegetables. To view the available options, go to topboxfoods.com/collections/linkmatch \n-When you’re ready to shop, add the products you’d like to order to your cart. At checkout, click Link Match to redeem the amount you’d like to save on the order. When you redeem, your Link Match dollars become a code valid for any products with fresh fruits or vegetables. Click “Discounts” to apply your new code to your order. Link Match can be redeemed in different amounts from $12.50 to $60, so you can use the right amount for the eligible products in your order.\n-Your order will be delivered to your home on your chosen delivery day, so you can enjoy nutritious, fresh fruits and
